export default {
  name: "Lifecycle",
  data() {
    return {
      str: '123'
    };
  },
  //1.当页面挂载的时候，前四个生命周期函数会被执行 (beforeCreate,created,beforeMount,mounted)
  //2.哪个阶段有$el和$data
  //3.加入keep-alive会多两个生命周期(activated[进入],deactivated[离开])
  beforeCreate() {
    //beforeCreate这个阶段不会挂载el和data
    console.log('beforeCreate', this.$el, this.$data);
  },
  created() {
    //created这个阶段会挂载data，不会挂载el
    console.log('created', this.$el, this.$data);
  },
  beforeMount() {
    //created这个阶段会挂载data，不会挂载el
    console.log('beforeMount', this.$el, this.$data);
  },
  mounted() {
    //mounted这个阶段会挂载data也会挂载el
    console.log('mounted', this.$el, this.$data);
  },
  beforeUpdate() {
    console.log('beforeUpdate');
  },
  updated() {
    //updated这个阶段会挂载data也会挂载el
    console.log('updated');
  },
  beforeDestroy() {
    console.log('beforeDestroy');
  },
  destroyed() {
    //destroyed这个阶段会挂载data也会挂载el
    console.log('destroyed');
  }
};
